create table phpbb_users
(
    user_id                  INTEGER
        primary key autoincrement,
    user_type                TINYINT(2)           default '0'         not null,
    group_id                 INTEGER UNSIGNED     default '3'         not null,
    user_permissions         MEDIUMTEXT(16777215) default ''          not null,
    user_perm_from           INTEGER UNSIGNED     default '0'         not null,
    user_ip                  VARCHAR(40)          default ''          not null,
    user_regdate             INTEGER UNSIGNED     default '0'         not null,
    username                 VARCHAR(255)         default ''          not null,
    username_clean           VARCHAR(255)         default ''          not null,
    user_password            VARCHAR(255)         default ''          not null,
    user_passchg             INTEGER UNSIGNED     default '0'         not null,
    user_email               VARCHAR(100)         default ''          not null,
    user_birthday            VARCHAR(10)          default ''          not null,
    user_lastvisit           INTEGER UNSIGNED     default '0'         not null,
    user_last_active         INTEGER UNSIGNED     default '0'         not null,
    user_lastmark            INTEGER UNSIGNED     default '0'         not null,
    user_lastpost_time       INTEGER UNSIGNED     default '0'         not null,
    user_lastpage            VARCHAR(200)         default ''          not null,
    user_last_confirm_key    VARCHAR(10)          default ''          not null,
    user_last_search         INTEGER UNSIGNED     default '0'         not null,
    user_warnings            TINYINT(4)           default '0'         not null,
    user_last_warning        INTEGER UNSIGNED     default '0'         not null,
    user_login_attempts      TINYINT(4)           default '0'         not null,
    user_inactive_reason     TINYINT(2)           default '0'         not null,
    user_inactive_time       INTEGER UNSIGNED     default '0'         not null,
    user_posts               INTEGER UNSIGNED     default '0'         not null,
    user_lang                VARCHAR(30)          default ''          not null,
    user_timezone            VARCHAR(100)         default ''          not null,
    user_dateformat          VARCHAR(64)          default 'd M Y H:i' not null,
    user_style               INTEGER UNSIGNED     default '0'         not null,
    user_rank                INTEGER UNSIGNED     default '0'         not null,
    user_colour              VARCHAR(6)           default ''          not null,
    user_new_privmsg         INT(4)               default '0'         not null,
    user_unread_privmsg      INT(4)               default '0'         not null,
    user_last_privmsg        INTEGER UNSIGNED     default '0'         not null,
    user_message_rules       INTEGER UNSIGNED     default '0'         not null,
    user_full_folder         INT(11)              default '-3'        not null,
    user_emailtime           INTEGER UNSIGNED     default '0'         not null,
    user_topic_show_days     INTEGER UNSIGNED     default '0'         not null,
    user_topic_sortby_type   VARCHAR(1)           default 't'         not null,
    user_topic_sortby_dir    VARCHAR(1)           default 'd'         not null,
    user_post_show_days      INTEGER UNSIGNED     default '0'         not null,
    user_post_sortby_type    VARCHAR(1)           default 't'         not null,
    user_post_sortby_dir     VARCHAR(1)           default 'a'         not null,
    user_notify              INTEGER UNSIGNED     default '0'         not null,
    user_notify_pm           INTEGER UNSIGNED     default '1'         not null,
    user_notify_type         TINYINT(4)           default '0'         not null,
    user_allow_pm            INTEGER UNSIGNED     default '1'         not null,
    user_allow_viewonline    INTEGER UNSIGNED     default '1'         not null,
    user_allow_viewemail     INTEGER UNSIGNED     default '1'         not null,
    user_allow_massemail     INTEGER UNSIGNED     default '1'         not null,
    user_options             INTEGER UNSIGNED     default '230271'    not null,
    user_avatar              VARCHAR(255)         default ''          not null,
    user_avatar_type         VARCHAR(255)         default ''          not null,
    user_avatar_width        INTEGER UNSIGNED     default '0'         not null,
    user_avatar_height       INTEGER UNSIGNED     default '0'         not null,
    user_sig                 MEDIUMTEXT(16777215) default ''          not null,
    user_sig_bbcode_uid      VARCHAR(8)           default ''          not null,
    user_sig_bbcode_bitfield VARCHAR(255)         default ''          not null,
    user_jabber              VARCHAR(255)         default ''          not null,
    user_actkey              VARCHAR(32)          default ''          not null,
    user_actkey_expiration   INTEGER UNSIGNED     default '0'         not null,
    reset_token              VARCHAR(64)          default ''          not null,
    reset_token_expiration   INTEGER UNSIGNED     default '0'         not null,
    user_newpasswd           VARCHAR(255)         default ''          not null,
    user_form_salt           VARCHAR(32)          default ''          not null,
    user_new                 INTEGER UNSIGNED     default '1'         not null,
    user_reminded            TINYINT(4)           default '0'         not null,
    user_reminded_time       INTEGER UNSIGNED     default '0'         not null
);

create index phpbb_users_user_birthday
    on phpbb_users (user_birthday);

create index phpbb_users_user_email
    on phpbb_users (user_email);

create index phpbb_users_user_type
    on phpbb_users (user_type);

create unique index phpbb_users_username_clean
    on phpbb_users (username_clean);

